define abstract entity ZETR_ABS_ITEM_FIELDS

{
  key Dummy               : abap.int4;
      costing_type        : zetr_e_ctype_exp;
      document_no         : abap.char(10);
      item_no             : abap.char(10);
      ba_type             : abap.char(1);
      gcb_no              : zetr_e_cedno;
      cost_center         : kostl;
      product             : matnr;
      net_weight          : abap.dec(23,2);
      volume              : abap.dec(23,2);
      invoice_amount      : abap.dec(23,2);
      invoice_amount_unit : gewei;
      cost_amount         : abap.dec(23,2);
      tax_type            : abap.char(2);
      tax_amount          : abap.dec(23,2);
      text                : abap.char(50);


      _Header             : association to parent Zetr_ABS_ROOT_PARAM on _Header.Dummy = $projection.Dummy;
}
